uint16_t cal_mds_table(uint16_t input) {
	uint8_t temp[2][2] = { 0 };
	for (int i = 0; i < 2; i++) {
		for (int j = 0; j < 2; j++) {
			if (j == 0) {
				temp[i][j] = (input >> ((1 - i) * 8)) & 0xFF;
			}
			else {
				temp[i][j] = Xtime_8(temp[i][j - 1]);
			}
		}
	}

	uint16_t mds_ret = 0;
	uint8_t tempsum = 0;
	for (int i = 0; i < 2; i++) {
		tempsum = 0;
		for (int j = 0; j < 2; j++) {
			uint8_t tempmultiply = 0;
			for (int k = 0; k < 2; k++) {
				tempmultiply ^= ((A16[i][j] >> k) & 0x01) * temp[j][k];
			}
			tempsum = tempsum ^ tempmultiply;
		}
		mds_ret = mds_ret << 8;
		mds_ret = mds_ret | tempsum;
	}
	return mds_ret;

}

