void yoroi(uint16_t input[]) {
	first_round(input);
	for (int i = 0; i < 6; i++) {
		mid_round(input);
	}
	last_round(input);
}

void yoroi_inv(uint16_t input[]) {
	last_round_inv(input);
	for (int i = 0; i < 6; i++) {
		mid_round_inv(input);
	}
	first_round_inv(input);
}

